import { directive } from "@babel/types";
import React from "react";

export default function Meaning(props) {
    console.log(props.meaning);
    return (
        <div className="Meaning">
            <h3>{props.meaning.partOfSpeech}</h3>
            <h4></h4>
        </div>
    )
}
